import React, { useState } from 'react';

function ChannelSubscriberCount() {
    const [channelId, setChannelId] = useState('');
    const [subscriberCount, setSubscriberCount] = useState('');

    const fetchSubscriberCount = () => {
        const apiKey = 'AIzaSyDnQnC0TzwCC_kaH2NJfdZG61kEfAeRM3Q';

        fetch(`https://www.googleapis.com/youtube/v3/channels?part=statistics&id=${channelId}&fields=items(statistics(subscriberCount))&key=${apiKey}&fullDetail=true`)
            .then(response => response.json())
            .then(data => {
                setSubscriberCount(data.items[0].statistics.subscriberCount);
            })
            .catch(error => console.error(error));
    };

    return (
        <div>
            <div>
                <label htmlFor="channelId">Enter YouTube Channel ID:</label>
                <input
                    type="text"
                    id="channelId"
                    value={channelId}
                    onChange={e => setChannelId(e.target.value)}
                />
            </div>
            <button onClick={fetchSubscriberCount}>Get Subscriber Count</button>
            {subscriberCount &&
                <h2>{subscriberCount} subscribers</h2>
            }
        </div>
    );
}

export default ChannelSubscriberCount;
